import React, { Component } from 'react';
import { HashRouter, Route, Switch } from 'react-router-dom';
import PropTypes from 'prop-types';
import './PhoneIdentification.css';
import './AttractLoop.css';
import Header from './Header';
import DialPad from './DialPad';



class PhoneNumberIdentification extends Component{
    constructor(props){
        super(props);
        this.state = {
            phoneNumber: '',
            defaultMessage:'Enter the Phone number associated with the account',
        };
        succesfullIdentification = (booleanDataFromDialPad) => {
            alert(booleanDataFromDialPad);
        };
    }

    render(){

        return(
            <div>

                <Header />
                <DialPad identificationfromDiaPad = {this.succesfullIdentification}/>  

            </div>
        );
    };

}


export default PhoneNumberIdentification;
PhoneNumberIdentification.propTypes = {


    history: PropTypes.shape({
      push: PropTypes.func,
    }).isRequired,
  };
